function Header() {
  return (
    <header className="header">
      <nav className="nav-top">
        <div className="container">
          <div className="nav-top__left"></div>
          <div className="nav-top__right"></div>
        </div>
      </nav>
      <nav className="nav-bottom"></nav>
    </header>
  );
}

export default Header;
